import React, { useEffect, useState } from 'react';
import "bootstrap/dist/css/bootstrap.css";
import { NavLink, useNavigate } from "react-router-dom";
import { useAuth } from "./AuthProvider";
import { Navbar as BootstrapNavbar, Nav, Container, Button, Spinner } from "react-bootstrap";

const Logo = "https://static.vecteezy.com/system/resources/thumbnails/013/948/616/small/bank-icon-logo-design-vector.jpg";

export default function Navbar() {
  const { logout, user } = useAuth();
  const [role, setRole] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const checkUserRole = async () => {
      if (user) {
        try {
          setIsLoading(true);
          const accountnum = localStorage.getItem("accountnum");
          const response = await fetch(`https://localhost:3001/user/checkUser?accountnum=${accountnum}`, {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
              Authorization: `Bearer ${localStorage.getItem("token")}`,
            },
          });

          if (response.ok) {
            const data = await response.json();
            setRole(data.role);
          } else {
            const errorData = await response.json();
            setError(errorData.message || "Error fetching role");
          }
        } catch (error) {
          console.error("Error checking user role:", error);
          setError("Network error");
        } finally {
          setIsLoading(false);
        }
      } else {
        setRole(null);
        setIsLoading(false);
        setError(null);
      }
    };

    checkUserRole();
  }, [user]);

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <BootstrapNavbar expand="lg" bg="light" className="shadow-sm py-3">
      <Container>
        <NavLink className="navbar-brand d-flex align-items-center" to="/">
          <img src={Logo} alt="Bank Logo" style={{ width: '40px', height: '40px', marginRight: '10px' }} />
          <span className="fw-bold text-primary">Banking Portal</span>
        </NavLink>
        <BootstrapNavbar.Toggle aria-controls="basic-navbar-nav" />
        <BootstrapNavbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto align-items-center">
            {isLoading && (
              <Spinner animation="border" variant="primary" size="sm" className="me-2" />
            )}

            {error && (
              <span className="text-danger me-3">{error}</span>
            )}

            {!user && !isLoading && (
              <>
                <NavLink className="nav-link text-primary" to="/login">Login</NavLink>
                <NavLink className="nav-link text-primary" to="/signup">Sign Up</NavLink>
                <NavLink className="nav-link text-primary" to="/tellerLogin">Employees</NavLink>
              </>
            )}

            {user && !isLoading && role === 'user' && (
              <>
                <NavLink className="nav-link text-primary" to="/viewtransactions">View Transactions</NavLink>
                <NavLink className="nav-link text-primary" to="/newtransaction">New Transaction</NavLink>
              </>
            )}

            {user && !isLoading && role === 'teller' && (
              <>
                <NavLink className="nav-link text-primary" to="/tellerSignup">Add Teller</NavLink>
                <NavLink className="nav-link text-primary" to="/viewAllTransactions">View All Transactions</NavLink>
              </>
            )}

            {user && !isLoading && (
              <Button variant="outline-primary" className="ms-3" onClick={handleLogout}>Logout</Button>
            )}
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
}
